import "./SensorData.css";

function SensorData(props) {
  var unit = "";
  var num = props.data;
  var name = props.name;
  if (props.name === "occupied") {
    name = "Seat Availability";
    if (props.data == 0){
      num = "Occupied";
    }
    else if (props.data == 1){
      num = "Leaving Soon";
    }
    else{
      num = "Vacant";
    }
  }
  return (
    <div className="box">
      <label className="title">{name}</label>
      <div className="valuebox">
        <label className="val">{num}</label>
      </div>
    </div>
  );
}

export default SensorData;
